import React, { Component } from 'react'

const LoginWrapper = {
    width: '400px',
    padding:' 20px 10px',
    boxSizing: "border-box",
    border: '1px solid #ccc',
    boxShadow: '2px 1px 3px #ccc',
    borderRadius: '3px',
    margin: 'auto'
};

const inputStyle = {
    width: '100%',
    height: '50px',
    lineHeight: '50px',
    borderRadius: '3px',
    border: '1px solid #ccc'
}
const divStyle = {
    margin: '40px',
    border: '5px solid pink'
  };

 class login extends Component {
     constructor(props){
         super(props);
         this.state = {
             email : ''
         }
     }
    render() {
        return (
            <div>
                <div style={LoginWrapper}>
                    <h1>Login</h1>
                    <label>Email</label>
                    <input styl={inputStyle} type="text" name="email" value={this.state.email} onChange={this.inputChange} />
                </div>
                
            </div>
        )
    }
}
export default login
